import React from 'react'
import { isButtonElement } from 'react-router-dom'
import NavItem from './NavItem'
import { v4 as uuidv4 } from 'uuid';

const navList = [
  {text: "Art", url: "/"},
  {text: "About", url: "/About"},
  {text: "More", url: "/More"}
]



const Navbar = () => {
  return (
    // <nav className='container mx-auto min-w-full sm:px-6 md:px-10 sm:py-3 md:py-4 bg-white box shadow-md hover:md:py-6 hover:text-lg border-solid border-b-[1px] border-stone-400 transition ease-in-out delay-150 hover:transition-all'>
    <nav className='flex flex-row bg-white bg-opacity-50 justify-around shadow-md hover:md:py-6 border-stone-400 ease-in-out transition-all duration-500 hover:flex group'>
      <div className='flex flex-row basis-1/4'>
        <h1 className='mx-auto'>Project Mayce</h1>
      </div>
      <div className='basis-1/4'></div>
      <ul className='flex flex-row basis-1/4 hover:basis-1/4 last:border-r-0'>
        {navList.map((item, i, isLast) => {
          return <NavItem
                  key={uuidv4()}
                  text={item.text}
                  url={item.url} 
                  isLast={i === navList.length-1 ? true : false}/>
        })}

        {/* <li className='inline-block my-auto w-1/3'>
          <a className='block text-center border-r-2 border-stone-300'>Art</a>
        </li>
        <li className='inline-block my-auto w-1/3'>
          <a href='' className='block text-center border-r-2 border-stone-300'>About</a>
        </li>
        <li className='inline-block my-auto w-1/3'>
          <a className='block text-center'>More</a>
        </li> */}
      </ul>
      
    </nav>
  )
}

export default Navbar
